import { Fragment, useEffect } from "react";

const ProductList = (props) => {

    const product = { id: 5, name: 'soap', description: 'cleans everything', price: 100 };

    useEffect( () => {
        console.log(product);
    });


    return (
        <Fragment>
            This is the List of Products!!!!
            <Productd_v1
                name={product.name}
                description={product.description}
                price={product.price} />

            <Productd_v2
                product={product} />
        </Fragment>
    );
};
export default ProductList;

const Productd_v1 = (props) => {

    const divStyle = {
        bordercolor: 'red',
        border: '2px solid red',
    };

    return (
        <div style={divStyle}>
            <h3>{props.name}</h3>
            <p>{props.description}</p>
            <p>Costs AUD $ {props.price}</p>
        </div>
    );
};


const Productd_v2 = (props) => {

    const divStyle = {
        bordercolor: 'red',
        border: '2px solid red',
    };

    return (
        <div style={divStyle}>
            <h3>{props.product.name}</h3>
            <p>{props.product.description}</p>
            <p>Costs AUD $ {props.product.price}</p>
        </div>
    );
};
